sys_variable_value.value:
(function () {
if (current.u_active == 'false')
return;
 
// Trigger internal reminder
gs.eventQueue('gift_giving.approval_reminder_internal', current, null, null);
 
// Trigger external approval reminders
var approvals = new GlideRecord('sysapproval_approver');
approvals.addQuery('document_id', current.sys_id);
approvals.addQuery('state', 'requested');
approvals.query();
 
while (approvals.next()) {
gs.eventQueue('gift_giving.approval_reminder_external', approvals, approvals.approver.sys_id + '', approvals.approver.name + '');        
}
})();

